      <div className="about-view">
        <img className="selfie-photo" src="./photos/Me2.jpg" alt="" />
        <h1>I like dad jokes and Mexican food!</h1>
        <p>
          Sup! My name is Noah, Iâ€™m a new transplant of Seattle, follower of
